    public int solution(int A, int B) {
        //count the number of perfect squares between (and including) A and B
        int count = 0;
        for(int i = 1; i < Math.sqrt(B); i++) {
            if(i * i >= A) {
                count++;
            }
        }
        return count;
    }
    
    public static String solution(String s) {
        int count = 0;
        if(s.length() < 2) {
            System.out.print("N: " + s.length() + "\t" + "O: " + count + "\t");
            return s;
        }
        StringBuilder sb = new StringBuilder(s);
        for(int i = 0; i < sb.length() - 2; i++) {
            count++;
            if(sb.charAt(i) == sb.charAt(i + 1)) {
                sb.deleteCharAt(i);
                sb.deleteCharAt(i);
                if(i >= 2) {
                    i = i - 2;
                } else {
                    i = 0;
                }
            }
        }
        if(sb.length() >= 2 && sb.charAt(0) == sb.charAt(1)) {
            sb.deleteCharAt(0);
            sb.deleteCharAt(0);
        }
        System.out.print("N: " + s.length() + "\t" + "O: " + count + "\t");
        return sb.toString();
    }
    
